import { useState } from 'react';
import {
    HashRouter,
    Route,
    Link,
    Switch,
    NavLink,
} from 'react-router-dom';
import * as Scroll from 'react-scroll';
import { Element, Events, animateScroll as scroll, scrollSpy, scroller } from 'react-scroll'
import Contact from '../Contact/Contact';
import HomeHeader_Two from './HomeHeaderTwo';




let HomeHeader = () => {

    let [startLink, setStartLink] = useState("")
    let [link, setLink] = useState("/Log/Log.js")
    function LinkTo() {
        setStartLink(el => !el)
        if(startLink !== false) {
            setLink("/#")
        }
    }


    return(
        <section className="HomeHeader">
            <div className="HomeHeader-One">

                <Link className="button" onClick={LinkTo} exact to={link}>Zaloguj</Link>
                <Link className="button" to="/rejestracja">Załóż konto</Link>

            </div>
            <HomeHeader_Two />
        </section>
    )
}

export default HomeHeader
